import Vue from "vue";
import VueI18n from "vue-i18n";
import vnMessage from "./vi.json";
import enMessage from "./en.json";

Vue.use(VueI18n);

const message = {
    vi: vnMessage,
    en: enMessage
};

const i18n = new VueI18n( {
    locate: 'vn',
    message,
    fallbackLocale: 'vn'
});

export default i18n;
